            <img src="https://images.pexels.com/photos/1408221/pexels-photo-1408221.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt="" />
       <p> Dan Joe, being a big knowledge seeker and a graphic designer has got a stunning About me page that immediately shows if he is ready for the new projects including web & print design, as well as branding.</p>
        </div>
    </div>
    </>
  );
}
